import React, { Component } from "react";
import "../scss/All_categorys.scss";

class All_categorys extends Component {
  render() {
    return (
      <div className="kategorije">
        <div className="kategorija">Slovenske pesmi</div>
        <div className="kategorija">Dalmatinske pesmi</div>
        <div className="kategorija">Angleške pesmi</div>
        <div className="kategorija">Ljudske pesmi</div>
        <div className="kategorija">Slovenska popevka</div>
        <div className="kategorija">Narodno zabavna glasba</div>
        <div className="kategorija">Otroške pesmice</div>
        <div className="kategorija">Božične pesmi</div>
      </div>
    );
  }
}

export default All_categorys;
